import React from 'react';

const News = () => {
	return (
			<section id="section1">
				For all media inquiries or interview requests, please contact Pete Dillon at Scoffer Consulting on 0409 142 365 or <a href="mailto:pdillon@scoffer.com.au">pdillon@scoffer.com.au</a>.
			</section>
	)
}


export default News;
